import React from 'react';
import styled from 'styled-components';

const ShowDetailsHeader = ({ name, description, image }) => {
    return (
        <header>
            <img src={image} alt="" />
            <h2>{name}</h2>
            <p>{description}</p>
        </header>
    );
}

export default ShowDetailsHeader;
